// ---  MAP DISPLAY 
function initMap() {
	map = new google.maps.Map(document.getElementById('map'), {
    	center: {lat: 52.011, lng: 4.357},
    	zoom: 13,
    	disableDefaultUI: true,
	});
	greenLayer = new google.maps.Data();
    greenLayer.loadGeoJson('http://data-delft.opendata.arcgis.com/datasets/8ec052576bd94271a354bddf6eccd287_1.geojson');
  playAreas = new google.maps.Data();
    playAreas.loadGeoJson('http://data-delft.opendata.arcgis.com/datasets/015274a3b1d040f0843ed73cf983fca2_0.geojson');
  parkingLayer = new google.maps.Data();
    parkingLayer.addGeoJson(parkingData); 

  bikeLayer = new google.maps.BicyclingLayer(); 
	trafficLayer = new google.maps.TrafficLayer();

  greenSetStyle();
  parkingSetStyle();
 
    //playAreas.setMap(map); 

  greenLayer.addListener('click', function(data_mouseEvent) {
          var feature = data_mouseEvent.feature;
          feature.toGeoJson(function(geojson){
            var infoWnd = new google.maps.InfoWindow({
              content: JSON.stringify(geojson.properties, null, 2),
              position: feature.getGeometry().getAt(0).getAt(0)
            });
            infoWnd.open(map);
          });
        });
}

/// --- STYLING FUNCTIONS
 function greenSetStyle(){
  colorGreen = "rgb(175, 255, 155)";
 greenLayer.setStyle(function(feature){
        greenArea = feature.getProperty('OPPERVLAKTE');
        if (greenArea > 200 && greenArea < 1000){
            colorGreen = "rgb(81, 216, 47)";
        } else if (greenArea > 1000) {
            colorGreen = "rgb(26, 104, 6)";
        } return {
            fillColor: colorGreen,
            strokeColor: colorGreen, 
            strokeWeight: 1
        }
    });
}
function parkingSetStyle(){
 parkingLayer.setStyle(function(feature){
        parkingSpots = feature.getProperty('aantal');
        // if (parkingSpots > 1 && parkingSpots < 5){
        //      colorParking = "rgb(81, 216, 47)";
        //  } else if (parkingSpots > 5) {
        //      colorParking = "rgb(26, 104, 6)";
        //   } 
        return {
            fillColor: colorParking,
            strokeColor: colorParking, 
            strokeWeight: 1
        }
    });
}
function updateSlider(slideAmount){
       document.getElementById("demo").innerHTML = colorParking;
       sliderValue = slideAmount;
       colorParking = "hsl(230, 100%,"+ slideAmount + "%)";
       parkingSetStyle();

       greenLayer.setStyle(function(feature){
              greenArea = feature.getProperty('OPPERVLAKTE');
              if (sliderValue > greenArea){
                  alertColor = 'red';
              } else {
                  greenSetStyle();
              } return {
                fillColor: alertColor,
                strokeColor: alertColor, 
                strokeWeight: 1
              }
        });
}

// ---  ON OFF FUNCTIONS
function greenOnOff() {
    if (greenLayerOn == false){
        greenLayer.setMap(map); 
        greenLayerOn = true;
        document.getElementById("GreenButton").value="Greenery: ON"
    } else if (greenLayerOn == true){
        greenLayer.setMap(null);
        greenLayerOn = false;
        document.getElementById("GreenButton").value="Greenery: OFF"
    }      
}

function bikeOnOff(){
	if (bikeLayerOn == false){
		bikeLayer.setMap(map);
		bikeLayerOn = true;
		document.getElementById("BikeButton").value="Bike Tracks: ON"
	} else if (bikeLayerOn == true){
		bikeLayer.setMap(null);
		bikeLayerOn = false;
		document.getElementById("BikeButton").value="Bike Tracks: OFF"
	}
}

function trafficOnOff(){
	if (trafficLayerOn == false){
		trafficLayer.setMap(map);
		trafficLayerOn = true;
		document.getElementById("TrafficButton").value="Traffic: ON"
	} else if (trafficLayerOn == true){
		trafficLayer.setMap(null);
		trafficLayerOn = false;
		document.getElementById("TrafficButton").value="Traffic: OFF"
	}
}

function parkingOnOff(){
  if (parkingLayerOn == false){
    parkingLayer.setMap(map);
    parkingLayerOn = true;
    document.getElementById("ParkingButton").value="Traffic: ON"
  } else if (parkingLayerOn == true){
    parkingLayer.setMap(null);
    parkingLayerOn = false;
    document.getElementById("ParkingButton").value="Traffic: OFF"
  }
}


